import React from 'react';
import PropTypes from 'prop-types'

const NavStyle = {
  position: 'absolute'
}

const Opacity = {
  background: 'none',
  position: 'absolute'
}

const Nav = (props) => {
  return(
    <header className="sticky-top">
      <nav className="navbar navbar-expand-lg" style={Opacity}>
        <a className="navbar-brand" href="#home">Internal Medicine</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarContent">
          <span className="navbar-toggler-icon" ></span>
        </button>
        <div className="collapse navbar-collapse float-right" id="navbarContent">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a className="nav-link" href="#home" style={props.navStyle}>Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#form" style={props.navStyle}>Forms</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="#contact" style={props.navStyle}>Contact Us</a>
            </li>
          </ul>
        </div>
      </nav>
    </header>
  );
}

Nav.propTypes={
  navStyle: PropTypes.object.isRequired
}

export default Nav;
